.container {
  position: fixed;
  border-top: 5px solid rgba(64,150,209,1) !important;
  min-width: 150px;
  padding: 10px;
  background-color: #fff;
  background-position: 10px 10px;
  background-size: 40px 40px;
  background-repeat: no-repeat;
}
.msgtxt{
  padding-left:10px;
  line-height: 15px;
  font-size: 14px;
  font-weight: bold;
  white-space: pre;
}
.btnbar {
  width: 100%;
  padding-top: 10px;
  padding-bottom: 5px;
  text-align: center;
}
.modal {
  position: fixed;
  left: 0;
  top: 0;
  width: 100%;
  height: 100%;
  background-color: rgba(0, 0, 0, 0.4);
  opacity: 0.4;
  filter: alpha(opacity=40);
}
